import React from 'react'
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

function Contato() {
  return (
    <Container fluid className='contato'>
    <Row>
      <Col>
        <h1>Fale Conosco</h1>
      </Col>
    </Row>

    <Row>
      <Col lg='6' md='6'></Col>
      <Col lg='6'></Col>
    </Row>
  </Container>
  )
}

export default Contato
